descricao:
A bromoprida está indicada para:
- Distúrbios da motilidade gastrintestinal (alteração na movimentação do estômago e intestino);
- Refluxo gastroesofágico (presença de conteúdo ácido dentro do esôfago proveniente do estômago);
- Náuseas e vômitos de origem central e periférica (cirurgias, metabólicas, infecciosas e problemas secundários ao uso de medicamentos). A bromoprida é utilizada também para facilitar os procedimentos radiológicos do trato gastrintestinal.

Furosemida é indicado nos casos de:

- Hipertensão arterial leve a moderada;
- Edema (inchaço) devido a distúrbios do coração, do fígado e dos rins;
- Edema (inchaço) devido a queimaduras.

Nitazoxanida é indicado para tratamento das seguintes infecções:
- Gastroenterites virais provocadas por rotavírus e norovírus;
- Helmintíases provocadas por nematódeos, cestódeos e trematódeos, como: Enterobius vermicularis, Ascaris
lumbricoides, Strongyloides stercolaris, Ancylostoma duodenale, Necator americanus, Trichuris trichiura,
Taenia sp e Hymenolepis nana;
- Amebíase, para tratamento da diarreia por amebíase intestinal aguda ou disenteria amebiana causada pelo
complexo Entamoeba histolytica/díspar;
- Giardíase, para tratamento da diarreia causada por Giardia lamblia ou Giardia intestinalis;
- Criptosporidíase, para tratamento da diarreia causada por Cryptosporidium parvum;
- Blastocistose, balantidíase e isosporíase, causadas, respectivamente, por Blastocistis hominis, Balantidium coli
e Isospora belli.

Noripurum 100mg é indicado para o tratamento de anemias e deficiências de ferro. Noripurum 100mg é indicado em:
- síndromes (conjunto de sinais e sintomas) da deficiência de ferro que ainda não se manifestou ou se manifestou de maneira suave;
- anemias ferroprivas devidas a subnutrição e/ou carências alimentares tanto de qualidade quanto de quantidade;
- anemias devidas a má absorção intestinal; anemia por deficiência de ferro (ferropriva) durante a gravidez e a amamentação; anemia devida a sangramentos recentes ou por períodos longos e em condições em que seja conveniente a suplementação de fatores produzidos pelo sangue.

Sinvastacor é indicado para reduzir os riscos à saúde decorrentes das doenças cardiovasculares. Se você tem doença arterial coronariana (DAC), diabetes, já teve derrame ou outra doença vascular, Sinvastacor:
- pode prolongar sua vida ao reduzir o risco de infarto do miocárdio (ataque cardíaco) ou de derrame;
- reduz a necessidade de cirurgia para melhorar o fluxo sanguíneo nas pernas e nos órgãos essenciais, tal como o coração;
- reduz a necessidade de hospitalização por dor no peito (conhecida como angina).

Sinvastacor reduz os níveis de colesterol no sangue.

Noripurum é indicado para o tratamento de anemias e deficiências de ferro.
Noripurum é indicado em:
• síndromes (conjunto de sinais e sintomas) da deficiência de ferro que ainda não se manifestou ou se
manifestou de maneira suave;
• anemias ferroprivas devidas a subnutrição e/ou carências alimentares tanto de qualidade quanto de
quantidade;
• anemias devido à má absorção intestinal;
• anemia por deficiência de ferro (ferropriva) durante a gravidez e a amamentação;
• Anemia devida a sangramentos recentes ou por períodos longos e em condições em que seja conveniente
a suplementação de fatores produzidos pelo sangue.

O Cloridrato de Terbinafina comprimidos é um medicamento indicado para:
- Onicomicose (infecção fúngica da unha) causada por fungos dermatófitos;
- Tinea capitis (infecção fúngica do couro cabeludo);
- Infecções fúngicas da pele para o tratamento de tinea corporis, tinea cruris, tinea pedis; infecções cutâneas causadas por leveduras do gênero Candida (por exemplo, Candida albicans), em que a terapia por via oral geralmente é considerada apropriada, conforme o local, a gravidade ou a amplitude da infecção.
Na Drogal você encontra todos os medicamentos que você precisa. Compre Cloridrato de Terbinafina 250mg com 14 comprimidos  - Medley

Secnidazol é destinado ao tratamento de:
- Giardíase (doença causada pelo protozoário Giardia lamblia);
- Amebíase intestinal sob todas as formas (doença causada pela presença de amebas no intestino);
- Amebíase hepática (doença causada pela presença de amebas no fígado);
- Tricomoníase (doença sexualmente transmissível, causada pelo protozoário Trichomonas vaginalis).

Pantoprazol é indicado para:
- Tratamento das lesões gastrintestinais leves;
- Alívio dos sintomas gastrintestinais decorrentes da secreção ácida gástrica;
- Gastrites ou gastroduodenites agudas ou crônicas e dispepsias não-ulcerosas;
- Tratamento da doença por refluxo gastroesofágico sem esofagite, das esofagites leves e de manutenção de pacientes com esofagite de refluxo cicatrizada para prevenção de recidivas em adultos e pacientes pediátricos acima de 5 anos;
- Profilaxia das lesões agudas da mucosa gastroduodenal induzidas por medicamentos como os anti-inflamatórios não-hormonais.

Secnidal é destinado ao tratamento de:
- giardíase (doença causada pelo protozoário Giardia lamblia);
- amebíase intestinal sob todas as formas (doença causada pela presença de amebas no intestino);
- amebíase hepática (doença causada pela presença de amebas no fígado);
- tricomoníase (doença sexualmente transmissível, causada pelo protozoário Trichomonas vaginalis).

O Cloridrato de propranolol é um betabloqueador indicado para: 
- Controle de hipertensão (pressão alta); - controle de angina pectoris (sensação de pressão e dor no peito);
- Controle das arritmias cardíacas (alterações no ritmo dos batimentos cardíacos); 
- Prevenção da enxaqueca (dor de cabeça forte);
- Controle do tremor essencial; 
- Controle da ansiedade e taquicardia (aumento dos batimentos cardíacos) por ansiedade; 
- Controle adjuvante da tireotoxicose (aumento da secreção da glândula tireoide) e crise tireotóxica; 
- Controle da cardiomiopatia hipertrófica obstrutiva (aumento do volume do coração e problemas no seu funcionamento); 
- Controle de feocromocitoma (tipo de tumor, geralmente benigno, localizado na glândula suprarrenal). Neste caso, o tratamento com cloridrato de propranolol deve apenas ser iniciado na presença de um bloqueio alfa efetivo.

Ancoron é indicado para os seguintes casos:
- distúrbios graves do ritmo cardíaco, inclusive aqueles resistentes a outras terapêuticas;
- taquicardia ventricular sintomática (aumento da frequência cardíaca que se origina nos ventrículos do coração);
- taquicardia supraventricular sintomática (aumento da frequência cardíaca que se origina nos átrios do coração);
- alterações do ritmo cardíaco associadas à síndrome de Wolff-Parkinson-White (uma forma de arritmia, que é uma
alteração na frequência ou no ritmo dos batimentos cardíacos).

Domperidona é destinado ao tratamento de:
- Síndromes dispépticas frequentemente associadas a um retardo de esvaziamento gástrico, refluxo gastroesofágico e esofagite:
- Sensação de empachamento epigástrico, saciedade precoce, distensão abdominal, dor abdominal alta;
- Eructação, flatulência;
- Náuseas e vômitos;
- Azia, queimação epigástrica com ou sem regurgitação de conteúdo gástrico.
- Náuseas e vômitos de origem funcional, orgânica, infecciosa ou alimentar ou induzidas por radioterapia ou tratamento medicamentoso (anti-inflamatórios, antineoplásicos). Uma indicação específica são as náuseas e vômitos induzidos pelos agonistas dopaminérgicos usados no tratamento da - Doença de Parkinson como a L-dopa e bromocriptina.

Aciclovir 200 mg é indicado para:
- o tratamento de Herpes zoster;
- o tratamento e recorrência (reaparecimento) das infecções de pele e mucosas causadas pelo vírus Herpes simplex;
- a prevenção de infecções recorrentes causadas pelo vírus Herpes simplex (supressão).
Aciclovir também é indicado para pacientes seriamente imunocomprometidos.
